// Blog_main.js

import React from 'react';

function Blog_main({ blogs }) {
  return (
    <div className="blog-main">
      <h2>Список блогов</h2>
      {blogs.length === 0 ? (
        <p>Нет созданных блогов</p>
      ) : (
        <ul>
          {blogs.map((blog, index) => (
            <li key={index}>
              <h3>{blog.blogName}</h3>
              {/* Вставьте другие данные блога, которые вы хотите отобразить */}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Blog_main;
